import { Text, FlatList, StyleSheet } from "react-native";
import React from "react";

const FlatListDemo = () => {
  const names = [
    {
      index: "1",
      name: "table",
    },
    {
      index: "2",
      name: "chair",
    },
    {
      index: "3",
      name: "pen",
    },
    {
      index: "4",
      name: "paper",
    },
  ];

  return (
    <FlatList
      style={styles.listStyle}
      keyExtractor={(key) => {
        return key.index;
      }}
      data={names}
      renderItem={({ item }) => {
        console.log(item.name);
        return <Text style={styles.txt}>{item.name}</Text>;
      }}
    />
  );
};
